import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View, Image } from "react-native";


export default function App() {
  return (
    <View style={styles.main_container}>
      <View style={styles.user_attendance}>
        <View style={styles.user_component}>
          <Text>ich komme heute später</Text>
          <View></View>
          <Image></Image>
        </View>
      </View>
      <View style={styles.attendance_eval}>
        <Text style={styles.attendance_eval_text}>x Leute kommen heute</Text>
        <Text style={styles.attendance_eval_text}>x Leute kommen heute nicht</Text>
        <Text style={styles.attendance_eval_text}>von x Leuten gibt es noch keine Rückmeldung</Text>
      </View>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  main_container: {
    flex: 1,
    borderWidth: 5,
    borderColor: "black",
    flexDirection: "column",
    backgroundColor: "#fff",
    justifyContent: "flex-start",
    alignItems: "stretch",
    margin: "2%"
  },
  user_attendance: {
    flex: 4,
    borderWidth: 5,
    borderColor: "black",
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
  user_component: {

  },
  attendance_eval: {
    flex: 1,
    flexDirection: "row",
    borderWidth: 5,
    borderColor: "black",
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
  attendance_eval_text: {
    flex: 1,
    borderWidth: 5,
    borderColor: "green",
    textAlign: 'center', // <-- the magic
    fontWeight: 'bold',
    fontSize: 18,
  }
});
